function validateJsonSchema(data, schema) {
  if (!schema || !schema.required) return { valid: true, errors: [] };

  const errors = [];
  for (const field of schema.required || []) {
    if (!(field in data)) {
      errors.push(`Missing required field: ${field}`);
    }
  }

  if (schema.properties) {
    for (const [key, propSchema] of Object.entries(schema.properties)) {
      if (key in data) {
        const value = data[key];
        const expectedType = Array.isArray(propSchema.type) ? propSchema.type : [propSchema.type];
        const actualType = value === null ? 'null' : typeof value === 'object' && Array.isArray(value) ? 'array' : typeof value;

        if (!expectedType.includes(actualType) && !(expectedType.includes('null') && value === null)) {
          errors.push(`Field ${key}: expected ${expectedType.join('|')}, got ${actualType}`);
        }
      }
    }
  }

  return { valid: errors.length === 0, errors };
}

