function safeRegex(pattern, flags) {
  try {
    // Patterns from JSON are already properly escaped - don't modify them!
    return new RegExp(pattern, flags || 'giu');
  } catch (e) {
    console.warn(`Invalid regex pattern: ${pattern}`, e);
