  const scoreBreakdown = {};
  let totalScore = 0;
  const matchDetails = [];

  for (const [categoryName, categoryData] of Object.entries(rules)) {
    const { base_weight, multiplier, patterns } = categoryData;

    if (!patterns || !Array.isArray(patterns)) continue;

    let categoryMatchCount = 0;
    const categoryMatches = [];

    for (const pattern of patterns) {
      const re = safeRegex(pattern, 'giu');
      if (!re) continue;

      re.lastIndex = 0;
      const matches = text.match(re);

      if (matches && matches.length > 0) {
        categoryMatchCount += matches.length;
        categoryMatches.push({
          pattern: pattern.substring(0, 50),
          count: matches.length,
          samples: matches.slice(0, 3).map(m => m.substring(0, 50) + (m.length > 50 ? '...' : ''))
        });
      }
    }

    if (categoryMatchCount > 0) {
      const categoryScore = calculateCategoryScore(base_weight, multiplier, categoryMatchCount);
      scoreBreakdown[categoryName] = categoryScore;
      totalScore += categoryScore;

      matchDetails.push({
        category: categoryName,
        matchCount: categoryMatchCount,
        score: categoryScore,
        matches: categoryMatches
      });
    }
  }

  if (totalScore > 100) totalScore = 100;

  j.scoreBreakdown = scoreBreakdown;
  j.score = totalScore;
  j.matchDetails = matchDetails;

