  });
  if (configItem) return configItem;

  const restoredItem = all.find(it => {
    const j = it?.json;
    return j && j._llm_context_restored === true;
  });
  if (restoredItem) return restoredItem;

  return all[0];
}

function findPgScore(all) {
  let score = null, src = null, raw = null;

  for (const it of all) {
    const j = it?.json;

    // Check for risk_score from Prompt Guard API
    if (j && typeof j.risk_score === 'number') {
      score = j.risk_score;
      src = 'json.risk_score (Prompt Guard API)';
      raw = j;
      break;
    }

    if (j && j.llm_result && typeof j.llm_result.score === 'number') {
      score = j.llm_result.score;
      src = 'llm_result.score (restored context)';
      raw = j.llm_result.raw_output;
      break;
    }

    if (typeof j === 'string') {
      const v = tryParse01(j);
      if (v !== null) { score = v; src = 'json:string'; raw = j; break; }
    }

    if (Array.isArray(j) && j.length) {
      const first = j[0];
      if (first && typeof first === 'object' && 'text' in first) {
        const v = tryParse01(first.text);
        if (v !== null) { score = v; src = 'array[0].text'; raw = first; break; }
      } else {
        const v = tryParse01(first);
        if (v !== null) { score = v; src = 'array[0]'; raw = first; break; }
      }
    }

    if (j && typeof j === 'object' && 'text' in j) {
      const v = tryParse01(j.text);
      if (v !== null) { score = v; src = 'json.text'; raw = j.text; break; }
    }

    if (j && j.data && Array.isArray(j.data) && j.data[0] && 'text' in j.data[0]) {
      const v = tryParse01(j.data[0].text);
      if (v !== null) { score = v; src = 'json.data[0].text'; raw = j.data[0].text; break; }
    }

    if (j && j.metrics && j.metrics.injectionScore !== undefined) {
      const v = tryParse01(j.metrics.injectionScore);
      if (v !== null) { score = v; src = 'json.metrics.injectionScore'; raw = j.metrics.injectionScore; break; }
    }
  }

  if (score === null) { score = 0; src = 'default:0'; raw = null; }

  return { score, src, raw };
}

