/**
 * Bloom_Prefilter - FIXED VERSION
 *
 * PROBLEM: Poprzednia implementacja dodawaÅ‚a peÅ‚ne frazy do Bloom Filter,
 * ale testowaÅ‚a krÃ³tkie n-gramy (3-6 znakÃ³w). To nigdy nie mogÅ‚o zadziaÅ‚aÄ‡,
 * bo Bloom Filter operuje na peÅ‚nych stringach, nie substringach.
 *
 * ROZWIÄ„ZANIE: Opcja A (Performance-Optimized)
 * - Indeksuj wszystkie n-gramy z dangerous patterns
 * - Testuj n-gramy z input text
 * - To zapewnia spÃ³jnoÅ›Ä‡: te same typy stringÃ³w w obu operacjach
 *
 * ROZWIÄ„ZANIE ALTERNATYWNE: Opcja B (Higher Accuracy)
 * - Indeksuj peÅ‚ne frazy
 * - Testuj sliding windows rÃ³Å¼nych dÅ‚ugoÅ›ci
 * - Wolniejsze, ale wykryje exact phrase matches
 */

class SimpleBloomFilter {
  constructor(size = 32768, k = 5, seed = 1337) {
    this.bits = new Uint8Array(size);
    this.size = size;
    this.k = k;
    this.seed = seed;
    this.itemCount = 0;
  }

  hash(str, seed) {
    let h = seed;
    for (let i = 0; i < str.length; i++) {
      h ^= str.charCodeAt(i);
      h = Math.imul(h ^ (h >>> 16), 0x85ebca6b);
      h = Math.imul(h ^ (h >>> 13), 0xc2b2ae35);
      h ^= h >>> 16;
    }
    return h >>> 0;
  }

  getHashes(item) {
    const hashes = [];
    for (let i = 0; i < this.k; i++) {
      const h = this.hash(item, this.seed + i) % this.size;
      hashes.push(h);
    }
    return hashes;
  }

  add(item) {
    const hashes = this.getHashes(item);
    for (const h of hashes) {
      this.bits[h] = 1;
    }
    this.itemCount++;
  }

  test(item) {
    const hashes = this.getHashes(item);
    for (const h of hashes) {
      if (this.bits[h] === 0) return false;
    }
    return true;
  }

  estimateFalsePositiveRate() {
    const bitsSet = this.bits.reduce((sum, bit) => sum + bit, 0);
    const p = bitsSet / this.size;
    return Math.pow(p, this.k);
  }
}

const DEFAULT_DANGEROUS_PATTERNS = [
  'ignore all instructions',
  'ignore previous instructions',
  'disregard instructions',
  'override system',
  'you are now',
  'act as dan',
  'jailbreak',
  'developer mode',
