      return acc;
    }, {});
  }

  return {};
};

const resolveConfig = (baseInput = {}, overrides = {}) => {
  const base = {
    ...DEFAULT_SETTINGS,
    ...baseInput,
    ...overrides,
  };

  const httpMethod = String(base.httpMethod || DEFAULT_SETTINGS.httpMethod).toUpperCase();
  if (!ALLOWED_METHODS.has(httpMethod)) {
    throw new Error(`ObsÅ‚ugiwana metoda HTTP musi byÄ‡ jednÄ… z: ${[...ALLOWED_METHODS].join(', ')}.`);
  }

  const rawRequests = Number(base.requestsToSend ?? DEFAULT_SETTINGS.requestsToSend);
  const requestsToSend = Number.isFinite(rawRequests)
    ? Math.min(Math.max(Math.round(rawRequests), 1), 1000)
    : DEFAULT_SETTINGS.requestsToSend;

  const targetUrl =
    typeof base.targetUrl === 'string' && base.targetUrl.trim() !== ''
      ? base.targetUrl.trim()
      : '';

  const sendRequests =
    typeof base.sendRequests === 'boolean' ? base.sendRequests : DEFAULT_SETTINGS.sendRequests;

  return {
    targetUrl,
    httpMethod,
    requestsToSend,
    headers: normalizeHeaders(base.headers),
    sendRequests,
  };
};

async function promptStressTester(options = {}) {
  const context = typeof this !== 'undefined' ? this : {};
  const continueOnFail =
    typeof options.continueOnFail === 'boolean'
      ? options.continueOnFail
      : typeof context.continueOnFail === 'function'
        ? context.continueOnFail()
        : false;

  if (PROMPTS.length === 0) {
    throw new Error('Brak wbudowanych promptÃ³w do wysÅ‚ania.');
  }

  const incomingItems =
    Array.isArray(options.items) ? options.items : typeof items !== 'undefined' ? items : [];
  const firstItemPayload = incomingItems[0]?.json ?? {};

  const config = resolveConfig(firstItemPayload, {
    targetUrl: options.targetUrl,
    httpMethod: options.httpMethod,
    requestsToSend: options.requestsToSend,
    headers: options.headers,
    sendRequests: options.sendRequests,
  });

  const shouldSendRequests = Boolean(config.sendRequests);

  const httpRequest = shouldSendRequests
    ? typeof options.httpRequest === 'function'
      ? options.httpRequest
      : context?.helpers?.httpRequest?.bind(context.helpers)
    : null;

  if (shouldSendRequests && typeof httpRequest !== 'function') {
    throw new Error(
      'Brak funkcji httpRequest. Uruchom kod w wÄ™Åºle Code w n8n lub przekaÅ¼ implementacjÄ™ przez options.httpRequest.',
    );
  }

  if (
    shouldSendRequests &&
    (!config.targetUrl || typeof config.targetUrl !== 'string' || config.targetUrl === '')
  ) {
    throw new Error(
      'Musisz zdefiniowaÄ‡ pole targetUrl (np. w pierwszym elemencie wejÅ›ciowym albo przez options.targetUrl).',
    );
  }

  const conversationId = generateConversationId();
  const output = [];

  for (let i = 0; i < config.requestsToSend; i += 1) {
    const randomPrompt = PROMPTS[Math.floor(Math.random() * PROMPTS.length)];
    const itemPayload = {
      sessionId: conversationId,
      chatInput: randomPrompt.content,
    };

    if (shouldSendRequests) {
      const requestOptions = {
        method: config.httpMethod,
        url: config.targetUrl,
        headers: config.headers,
        json: true,
        body: itemPayload,
      };

      try {
        await httpRequest(requestOptions);
      } catch (error) {
        if (!continueOnFail) {
          throw new Error(
            `Å»Ä…danie #${i + 1} do "${config.targetUrl}" nie powiodÅ‚o siÄ™. SzczegÃ³Å‚y: ${error.message}`,
          );
        }
      }
    }

    output.push({
      json: itemPayload,
    });

    if (i < config.requestsToSend - 1 && shouldSendRequests) {
      await delay(DELAY_MS);
    }
  }

  return output;
}

